  <style>
    #loader-wrapper {
      display: flex;
      align-items: center;
      justify-content: center;
      text-align: center;
      margin-top: 100px
    }

    #loader-wrapper .hzero-logo {
      position: relative;
      width: 24px;
      height: 24px;
      background-image: url(/hzero_logo_loading.svg);
      background-size: 24px 24px;
      background-repeat: no-repeat;
      margin-left: -52px
    }

    #loader-wrapper .load {
      width: 80px;
      animation: loading 3s linear infinite
    }

    #loader-wrapper .load .loading-inner {
      animation: loading-circle 2s linear infinite, colors 6s ease-in-out infinite;
      fill: transparent;
      stroke: #29bece;
      stroke-dashoffset: 0;
      stroke-dasharray: 300;
      stroke-width: 10;
      stroke-miterlimit: 10;
      stroke-linecap: round
    }

    @keyframes loading {
      0% {
        transform: rotate(0)
      }

      100% {
        transform: rotate(360deg)
      }
    }

    @keyframes loading-circle {
      0% {
        stroke-dashoffset: 0
      }

      100% {
        stroke-dashoffset: -600
      }
    }

    @keyframes colors {
      0% {
        stroke: #0687ff
      }

      25% {
        stroke: #52a4f1
      }

      75% {
        stroke: #318ee4
      }

      100% {
        stroke: #0687ff
      }
    }
